import React from 'react';
import UsersList from './UsersList';
import './users.css';

class Users extends React.Component {
  render() {
    // console.log(' this.state', this.state);
    return (
      <div>
        <h1>Users Page</h1>
        <UsersList />
      </div>
    );
  }
}

export default Users;
